import { titleColorMap } from '../../config';
import type { PersonalityType } from '../../types';
import s from './PersonalityCard.module.css';
interface PersonalityCardProps {
  title: string;
  type: PersonalityType;
  description: string[];
  category: string;
}
export const PersonalityCard = ({
  type,
  description,
  title,
