}: PersonalityCardProps) => <Card component='a' href={`/types/${type}`} className={s.wrapper}>
        <Box data-type={type} className={s.imageWrapper} data-color={titleColorMap[category]} />
        <Title className={s.title} order={3}>
            {title} ({type})
